import { DefaultTheme } from 'react-native-paper'

export const theme = {
  ...DefaultTheme,
  colors: {
    ...DefaultTheme.colors,
    surface: '#1B2732',
    text: '#ffffff',
    primary: '#DC143C',
    error: '#f13a59',
    placeholder: '#ffffff',
  },
}
